--
-- 表的结构 `post_meta`
--

CREATE TABLE IF NOT EXISTS `post_meta` (
  `id` int(11) NOT NULL,
  `name` varchar(100) DEFAULT NULL COMMENT '名称',
  `parent` int(11) unsigned DEFAULT NULL COMMENT '父级ID',
  `alias` varchar(32) DEFAULT NULL COMMENT '变量（别名）',
  `type` varchar(32) DEFAULT NULL COMMENT '项目类型',
